function multiSelectController(e){e.options=[{name:"Option A",value:10,active:!1},{name:"Option B",value:20,active:!0},{name:"Option C",value:30,active:!1},{name:"Option D",value:40,active:!1}];e.toggleActive=function(e){e.active=!e.active};e.total=function(){var t=0;angular.forEach(e.options,function(e){e.active&&(t+=e.value)});return t}};